import React, { useState, useEffect } from "react";

function ResetButton({ next }) {
    return (
        <>
            <div id="ResetBtn" className="justify-content-center mt-1 btn btn-primary ml-2 mb-3" onClick={next}>
                Reset
            </div>
        </>
    );
}

export default ResetButton;
